import React from 'react';
import ReactDOM from 'react-dom';

function getDays(){
    console.log("fetching python");
    fetch('192.168.10.104:5000/love', {
        method: 'GET',
        mode: 'no-cors',
        dataType: 'json'
    })
    .then(r => r.json())
    .then(r => {
        console.log(r);
    })
}
console.log(getDays());
